No One Needs To Die

Sociopolitical Documentary hosted by David Seys, published by Galloping Films in 2011 - English narration


Information
------------------------------

Health care - a universal nightmare far governance. Bring in 1 billion people and the magnitude of the responsibility is unimaginable. This documentary gets personal because one of them lost his wife in a road accident because there were not enough ambulances and the hospital did not care enough. So Kushwaha, a 38 year-old lawyer, created his own 'On-line Ambulance Service&quot; for accident victims because he believes that no one has to die. He takes this one step further by picking up the helpless and homeless found in the city and builds shelters for the mentally challenged who have been abandoned by their families. This is a story of unbelievable courage of an individual determined to turn a personal tragedy into a communal good.

